import React, { Component } from 'react';
import './index.css'
class Parent extends Component {
  render() {
    return (
      <div className="parent">
        <h3>我是 Parent 组件</h3>
        <A />
      </div>
    );
  }
}
class A extends Component {
  render() {
    return (
      <div className="a">
        <h3>我是 A 组件</h3>
        <B />
      </div>
    );
  }
}
class B extends Component {
  render() {
    return (
      <div className="b">
        <h3>我是 B 组件</h3>
      </div>
    );
  }
}

export default Parent;
